`,l(t.p,{children:"For the first 3 days, I was essentially coding up the designs in real time as they were being made. I wasn't afraid about having to undo my work because tailwind makes it really easy to build designs fast."}),`
`,l(t.p,{children:"Here's an example of some of the early designs:"}),`
`,l(t.p,{children:l(t.img,{src:"/cg-fabl_3.png",alt:""})}),`
